import "./Howworks.css";
const Howworks = () => {
  return (
    <>
      <section className="nsection3">
        <h3>HOW OSF WORKS</h3>
        <div></div>
        <p>
        At OSF, we connect businesses and organizations with skilled professionals who are looking for flexible, remote work opportunities. Our platform makes it easy for employers to find and hire top talent, and for workers to find and apply for jobs that fit their skills and schedule.
        </p>
        <button>LEARN MORE</button>
      </section>
    </>
  );
};

export default Howworks;
